import { ProductRow } from "./ProductRow";

export function ProductCategoryRow(props) {

    //var categoryData;

    console.log(props.data)

    props.data.sort((a, b) => {
        if (a.category > b.category) {
            return 1
        }
        if (a.category < b.category) {
            return -1
        }
        return 0
    })

    console.log("changed:", props.data)

    /*props.data.map(row => (
        console.log(row.category)
    ))*/



    return (
        <>
            <tr>
                <th>category</th>
            </tr>
            <ProductRow />
        </>
    )

}
